const SideBar = () => {
    return(
        <div class="col-lg-3">
            <h5 class="my-4">Buy Services</h5>
            <div class="list-group">
                <a href="#" class="list-group-item">Daily</a>
                <a href="#" class="list-group-item">Weekly</a>
                <a href="#" class="list-group-item">Monthly</a>
            </div>
        </div>
    );
}

export default SideBar;
